    <tr><td headers="field" class="gt_row gt_left" style="border-top-width: 1.5px; border-top-style: dotted; border-top-color: black;"><b>covered_recipient_profile_type</b>:<br><br>Indicator showing if recipient of the payment or other transfer of value is a covered recipient physician or covered recipient non-physician practitioner. Example values: Covered Recipient Physician (If the profile is a Physician profile) Covered Recipient Non-Physician Practitioner(If the profile is a Non-Physician Practitioner profile), Covered Recipient Physician/Covered Recipient Non-Physician Practitioner (If the profile is identified as both Physician and a Non-Physician Practitioner)</td></tr>
