    <tr><td headers="field" class="gt_row gt_left" style="border-top-width: 1.5px; border-top-style: dotted; border-top-color: black;"><b>associated_covered_recipient_profile_id_1</b>:<br><br>Covered_Recipient_Profile_ID of first profile (with/without NPI) associated with the same physician/non-physician practitioner.</td></tr>
    <tr><td headers="field" class="gt_row gt_left" style="border-top-width: 1.5px; border-top-style: dotted; border-top-color: black;"><b>associated_covered_recipient_profile_id_2</b>:<br><br>Covered_Recipient_Profile_ID of second profile (with/without NPI) associated with the same physician/non-physician practitioner.</td></tr>
    <tr><td headers="field" class="gt_row gt_left" style="border-top-width: 1.5px; border-top-style: dotted; border-top-color: black;"><b>covered_recipient_npi</b>:<br><br>National Provider Identifier is a unique identification number for covered recipient physician or non-physician practitioner (and not the NPI of a group the physician/non- physician practitioner belongs to).</td></tr>
    <tr><td headers="field" class="gt_row gt_left" style="border-top-width: 1.5px; border-top-style: dotted; border-top-color: black;"><b>covered_recipient_profile_first_name</b>:<br><br>The first name as available in the CMS-provided Master Profile List (MPL) for Physician\NPPs and non-physician practitioner that were successfully matched on the list. For physicians/non-physician practitioner who are not on the CMS-provided MPL and were matched against the external physician/ non-physician practitioner matching service, the name as verified against the external physician/ non- physician practitioner matching service is displayed.</td></tr>
    <tr><td headers="field" class="gt_row gt_left" style="border-top-width: 1.5px; border-top-style: dotted; border-top-color: black;"><b>covered_recipient_profile_middle_name</b>:<br><br>The middle name as available in the CMS-provided MPL for physician/ non-physician practitioners that were successfully matched on the list. For physician/non- physician practitioner s who are not on the CMS-provided MPL and were matched against the external physician/ non-physician practitioner  matching service, the middle name is determined by the most frequently reported by AM/GPOs through the record submission in the latest year when the physician/ non-physician practitioner is reported.</td></tr>
    <tr><td headers="field" class="gt_row gt_left" style="border-top-width: 1.5px; border-top-style: dotted; border-top-color: black;"><b>covered_recipient_profile_last_name</b>:<br><br>The last name as available in the CMS-provided MPL provided by CMS for physician/ non-physician practitioners that were successfully matched on the list. For physician/ non-physician practitioners who are not on the CMS- provided MPL and were matched against the external physician/ non-physician practitioner matching service, the name as verified against the external physician/ non- physician practitioner matching service is displayed.</td></tr>
    <tr><td headers="field" class="gt_row gt_left" style="border-top-width: 1.5px; border-top-style: dotted; border-top-color: black;"><b>covered_recipient_profile_suffix</b>:<br><br>The suffix as available in the CMS-provided MPL for physician/non-physician practitioners that were successfully matched on the list. For physician/non- physician practitioners who are not on the CMS-provided MPL and were matched against the external physician/non-physician practitioner matching service, the suffix is determined by the most frequently reported by AM/GPOs through the record submission in the latest year when the physician/non-physician practitioner is reported.</td></tr>
    <tr><td headers="field" class="gt_row gt_left" style="border-top-width: 1.5px; border-top-style: dotted; border-top-color: black;"><b>covered_recipient_profile_alternate_first_name</b>:<br><br>The alternate first name as available in the CMS-provided MPL for physician/non-physician practitioner that were successfully matched on the list. For physician/non- physician practitioner who are not on the CMS-provided MPL and were matched against the external physician/non-physician practitioner matching service, the alternate first name is displayed blank.</td></tr>
