    <tr><td headers="field" class="gt_row gt_left" style="border-top-width: 1.5px; border-top-style: dotted; border-top-color: black;"><b>covered_recipient_profile_alternate_suffix</b>:<br><br>The alternate suffix as available in the CMS-provided MPL for physician/non-physician practitioner that were successfully matched on the list. For physician/non- physician practitioner who are not on the CMS-provided MPL and were matched against the external physician/non-physician practitioner matching service, the alternate suffix is displayed blank.</td></tr>
