## Querying

::: {.cell}

```{.r .cell-code}
format_query_open <- function(args, op = "=") {

  args  <- discard(args, is.null)

  query <- glue(
  "
  'conditions[{i}][property]' = '{PROPERTY}',
  'conditions[{i}][operator]' = '{OPERATOR}',
  'conditions[{i}][value]' = '{VALUE}'
  ",
    i                 = seq_along0(args),
    PROPERTY          = names(args),
    OPERATOR          = op,
    VALUE             = args) |>
    glue_collapse(sep = ",\n")

  glue("c({query})") |>
    parse_expr() |>
    eval_bare()
}

create_request_open <- function(id, args) {

  id |>
    open_uuid_url() |>
    request() |>
    req_url_query(
      !!!format_query_open(args),
      schema  = "false",
      keys    = "false",
      offset  = 0
    )
}

query_nresults_open <- function(req) {

  req_url_query(
    req,
    results = "false", 
    count   = "true", 
    offset  = 0, 
    limit   = 1) |>
    perform_simple() |> 
    _[["count"]]

}

perform_request_open <- function(req) {

  req_url_query(
    req,
    results = "true", 
    count   = "false", 
    offset  = 0, 
    limit   = 500) |>
    perform_simple()

}

format_query_open(
  c(
    covered_recipient_npi = 1023630738, 
    covered_recipient_profile_city = "Valdosta")
  ) |> 
  fuimus::print_ls()
